description:
National anthem of Ukraine on Nokt's alto recorder


How you can help:
- Spread true information about this war;
- DO NOT buy any russian goods; 
- block russian artists/bloggers/musicians who support putin madness or just say 'we are out of politics' while their taxes turn into russian bullets. Do not feel sorry for those who hysterically mourn the loss of Instagram and cola in stories - Ukrainians are losing their houses, families and lifes at the same time;
- Ask your goverments for military and humanitarian help for Ukraine. You can also collect humanitarian aid yourself.;
- Ask your goverments for more sanctions for Russia;
- Donate to Ukrainian humanitarian and military funds:
https://savelife.in.ua/en/donate/
https://bank.gov.ua/en/about/support-the-armed-forces 
You can also help battalion of belarusian warriors and our friends who is fighting for Ukraine right now:
Paypal: gunalya12@gmail.com 

